import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import './App.css';
import Atlas from './Pages/Atlas/Atlas.jsx';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<Atlas />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
